import * as React from 'react';
import { View, Text} from 'react-native';
import { Button } from 'react-native-web';

const HeaderRight = () => {
    return(
        <View>
             
            <button type="button" style={{paddingRight: -20}}> oi </button>
            
        </View>
    )
}
export default HeaderRight;
